import React from "react";
import Data from "./Data";

const Card = () => {
  return (
    <>
      <div className="cards">
        <div>
          {Data.map((elem) => {
            let { id, title, desc, imgUrl } = elem;
            return (
              <>
                <div className="card"></div>
              </>
            );
          })}
        </div>
      </div>
    </>
  );
};

export default Card;
